from sympy import divisors
def aupton(terms):
    alst, aset = [1, 2, 3], {1, 2, 3}
    while len(alst) < terms:
        concat = int("".join(map(str, alst[-3:])))
        an = min(d for d in divisors(concat) if d not in aset)
        alst.append(an); aset.add(an)
    return alst
